import { CompletedTask, EditingTask, Task } from "../task";
import NewTaskForm from "../new-task-form";

const TodoList = () => {
  let content = NewTaskForm.value;
  console.log(content);
  return (
    <ul className="todo-list">
      <CompletedTask />
      <EditingTask />
      <Task />
    </ul>
  );
};

export default TodoList;
